import React, {useState} from 'react';
import Navbar from '../Components/Navbar'

import '../Styles/Predict.css'

function Predict() {

    let tempResult;
    let coResult;
    const [tempYear, setTempYear] = useState(0);
    const [tempMonth, setTempMonth] = useState(0);

    const [coYear, setCoYear] = useState(0);
    const [coMonth, setCoMonth] = useState(0);

    return (
        <>
        <Navbar />
            <h1 className="predict-title">Predict Future Values</h1>
            <div class="wrapper temp">

                <div className="inputs temp">
                    <h2 className="subtitle">Predict Future Temperature Value</h2>
                    <input class="year" type="number" placeholder={"Year (2023-2100)"} onSubmit = {(e) => {
                        e.preventDefault();
                        console.log(e);
                    }}/> {/* 2023 - 2100 */}
                    <input class="month" type="number" placeholder="Month (1 = Jan, 12 = Dec)" />

                </div>

                <div className="results temp">
                    <h3>Temperature Result: </h3><h4>NONE</h4>
                </div>

            </div>

            <div className="wrapper co">
                <div className="inputs co">
                    <h2 className="subtitle">Predict Future CO<sub>2</sub> Value</h2>
                    <input class="year" type="number" placeholder={"Year (2023-2100)"} /> {/* 2023 - 2100 */}
                    <input class="month" type="number" placeholder="Month (1 = Jan, 12 = Dec)" />
                </div>

                <div className="results co">
                    <h3>Co<sub>2</sub> Result: </h3><h4>NONE</h4>
                </div>
            </div>
        </>
    )
}

export default Predict;
